---
description: "Lato is a free font comparable to Gill Sans: warm, stable, and serious."
css: |
     @font-face {
       font-family: 'Lato';
       font-style: normal;
       font-weight: 400;
       src: local('Lato Regular'), local('Lato-Regular'),
            url(data:font/woff2;base64,) format('woff2');
     }

     @font-face {
       font-family: 'Lato';
       font-style: italic;
       font-weight: 400;
       src: local('Lato Italic'), local('Lato-Italic'),
            url(data:font/woff2;base64,) format('woff2');
     }

     @font-face {
       font-family: 'Lato';
       font-style: normal;
       font-weight: 700;
       src: local('Lato Bold'), local('Lato-Bold'),
            url(data:font/woff2;base64,) format('woff2');
     }

     @font-face {
       font-family: 'Lato';
       font-style: italic;
       font-weight: 700;
       src: local('Lato Bold Italic'), local('Lato-BoldItalic'),
            url(data:font/woff2;base64,) format('woff2');
     }

     body {
       font-family: 'Lato', sans-serif;
     }
